import React from "react";
import TextField from "@material-ui/core/TextField";

const AnalyticalViewTab = () => {
  return (
    <div>
      <TextField
        label="Distribution Channel"
        variant="outlined"
        margin="normal"
      />
      <TextField
        label="Customer Number"
        variant="outlined"
        margin="normal"
      />
    </div>
  );
};

export default AnalyticalViewTab;
